    let admins = "";

    setTimeout(() => {
        admins = require('./productos.json');

    }, 2000);

    async function prueba () {
        let test = await admins; 
        console.log(test);
    }

    prueba();


    return ( 
        <h1>Aqui van los productos</h1>

    );
}
